Всем привет!
Ребята с дружественного проекта ищут себе специалиста. Расположение - Киев, Украина (помощь при релокации обеспечивается):

Genesis is searching for Data Scientist who will take control over strategic tasks. Recently we launched a new project for US market, already attracted first millions of users and we continue to grow very fast.  Now are trying to implement new techniques which will give us outstanding market advantages.

So, what You’ll Be Doing:
- Analysis and Building Predictive Models for our advertising network;
- Build algorithms for our ad delivery system (using AI elements);
- Constantly improve results of algorithms.

What We’ll Expect from You:
- Data-driven business decisions (Hypothesis checking, estimations, A/B testing, etc.);
- Data analysis to identify the causes of deviations of key metrics and operations optimization;
- Quick iterations;
- Basic understanding of development process;
- Practical SQL knowledge;
- Statistics knowledge;
- +1 years of professional experience

You will work with some of the smartest and most interesting people in the industry. We work hard, but we always have fun doing it.

